import logo from './divumimages.png';
import './App.css';
import React from 'react'; 
import {BrowserRouter as Link,Route,Router} from 'react-router-dom';
import Fetchtable from './Fetchtable';
import Add from './Add';


function App() {

  return (
    <div className="main_layout">
     <div className="header"> <img src={logo} className="App-logo" alt="logo" />
      <Router><div className="headerbutton"><Link to='./add'><button >Add+</button></Link>
      <Route path="./add" component={Add}/></div></Router></div>
      <Fetchtable />
    </div>
  );
}

export default App;
